import React from 'react';
import {Switch, Route} from 'react-router-dom'
import {Home, SearchTemplate,notfound,OrderListTemplate,UserInfoTemplate,LoginTemplate} from './index';

const pRouter = (props) =>(
    <Switch>
        <Route exact path={`${props.match.url}`} component ={Home}/>
        <Route path ={`${props.match.url}/orders`} component={OrderListTemplate}/>
        <Route path ={`${props.match.url}/user`} component={UserInfoTemplate}/>
        <Route path ={`${props.match.url}/login`} component={LoginTemplate}/>
        <Route exact path={`${props.match.url}/*`} component={notfound}/>
    </Switch>
)

export default pRouter;
